import React from "react";
import {Text,StyleSheet,Image} from "react-native";

const GameDetailsScreen = (props) => {;
	return <View>
		<Text>{props.result}</Text>
	</View>
}

const styles = StyleSheet.create({
	Image:{
		width:100,
		height:100
	}
});
export default GameDetailsScreen;
